export const fructsLoaded = ( newFructs ) => {
    return {
        type: 'FETCH_FRUCTS_SUCCESS',
        payload: newFructs
    }
}

export const fructsRequresd = () => {
    return {
        type: 'FETCH_FRUCTS_REQUREST'
    }
}

export const fructsError = (error) => {
    return {
        type: 'FETCH_FRUCTS_FAILURE',
        payload: error
    }
}

export const onAddToCart = ( bookId ) => {
    return {
        type: 'FRUCT_ADDED_TO_CART',
        payload: bookId
    }
}

export const onIncrease = () => {
    return {
        type: 'FRUCT_ADDED_TO_CART',
        payload: bookId
    }
}
export const onDecrease = () => {
    return {
        type: 'DECREASE_FRUCTBOOK_COUNT',
        payload: bookId
    }
}

export const onDelete = () => {
    return {
        type: 'DELETE_FRUCT',
        payload: bookId
    }
}
